var app=angular.module("TwitterNames",[]);app.controller("MainController",["$scope","$http",function(a,b){var c=[],d=[];a.getNouns=function(){b({method:"GET",url:"assets/data/nouns.json"}).then(function(b){a.nouns=b.data;for(var d=0;d<a.nouns.length;)c.push(a.nouns[d].noun),d++;console.log(c)})},a.getAdjectives=function(){b({method:"GET",url:"assets/data/adjectives.json"}).then(function(b){a.adjectives=b.data;for(var c=0;c<a.adjectives.length;)d.push(a.adjectives[c].adjective),c++;console.log(d)})},a.getNouns(),a.getAdjectives()}]);